import React from 'react';
import { Link }  from 'react-router-dom';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlayCircle } from '@fortawesome/free-solid-svg-icons';
import { faCompactDisc } from '@fortawesome/free-solid-svg-icons';

const Track = (props) => {
    const { track } = props;
    const playmusic = <FontAwesomeIcon icon={faPlayCircle} />

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">
                    <p className="card-text">


                    <i className="fa fa-play"></i><strong>Track</strong>: {track}</p> 
                    <i className="fas fa-compact-disc"></i><p> <strong>Artist:</strong>  <h6>{props.artist}</h6>

                    </p>

                    <img src={props.cover} width='150'></img>
                    <p></p>
                    <p><strong>Album:</strong> {props.album}</p>
                   <Link to={`lyrics/track/${props.id_track}`}
                   className="btn btn-dark btn-block"> View Lyrics</Link>
                </div>
            </div>

        </div>
    )
}
export default Track;
